import React from 'react';
import Panel from './Panel';
import './PanelList.css';

const PanelList = ({ pokedex, carNumb, onClick }) => {
    const functionForEvent = () => {
        console.log(carNumb);
        // console.log(PanelCompon[carNumb]);
    }

    const handleEvent = event => {
        functionForEvent();
    }

    const PanelCompon = pokedex.map((pokemon, i) => {
        return <Panel onChildEvent={handleEvent} cardPos={carNumb} panelId={i} id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })


    return (
        <div>
            <div>
                <div>

                </div>
            </div>
            <div>
                {PanelCompon}
            </div>
        </div>
    );
}

export default PanelList;
